using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

namespace LeetCode.problems
{
    class _214 : BaseClass
    {
        public override void Run()
        {
            string t;

            t = ShortestPalindrome("");
            Assert(t, "");
            t = ShortestPalindrome("a");
            Assert(t, "a");
            t = ShortestPalindrome("abab");
            Assert(t, "babab");
            t = ShortestPalindrome("abbabaab");
            Assert(t, "baababbabaab");
            t = ShortestPalindrome("aaaa");
            Assert(t, "aaaa");
            t = ShortestPalindrome("aaa");
            Assert(t, "aaa");
            var input = "";
            t = ShortestPalindrome(input);
            //Assert(input, t);
            t = ShortestPalindrome("aacecaaa");
            Assert(t, "aaacecaaa");
            t = ShortestPalindrome("abcd");
            Assert(t, "dcbabcd");
            t = ShortestPalindrome("aba");
            Assert(t, "aba");
            t = ShortestPalindrome("abcdcba");
            Assert(t, "abcdcba");
        }

        #region 马拉车
        public string ShortestPalindrome(string s)
        {
            var ns = "[#" + string.Join("#", s.ToArray()) + "#]";
            int maxR = 1, c = 1, r = 1;
            var p = new int[ns.Length];
            for (int i = 2; i < p.Length - 2; i++)
            {
                int imirror = (c << 1) - i;
                if (p[imirror] + i < r)
                    p[i] = p[imirror];
                else
                {
                    p[i] = Math.Min(p[imirror], r - i);
                    while (ns[i - p[i] - 1] == ns[i + p[i] + 1])
                        p[i] += 1;
                    if (p[i] + i <= r)
                        continue;
                    c = i;
                    r = c + p[c];
                    if (c - p[c] == 1 && maxR < r)
                        maxR = r;
                }
            }
            return new string(s.Substring(maxR >> 1).Reverse().ToArray()) + s;
        }
        #endregion

        #region 暴力
        public string ShortestPalindrome2(string s)
        {
            int lenHW;
            for (lenHW = s.Length; lenHW >= 0; lenHW--)
                if (IsHW(s, lenHW))
                    break;

            return new string(s.Substring(lenHW).Reverse().ToArray()) + s;
        }

        private bool IsHW(string s, int len)
        {
            for (int i = (len >> 1) - 1; i >= 0; i--)
                if (s[len - i - 1] != s[i])
                    return false;
            return true;
        }
        #endregion
    }
}
